import React from 'react'

import logo from '../../assets/logo.png';
import './index.css'
import Deconnexion from '../components/DE'

const Header = (props) => {
    return (
        <header className="App-header">
            
            <img src={logo} className="App-logo" alt="logo" />
        <p>
          {props.label}
        </p>


      </header>
    )
}

export default Header
